      }
    }
  }




  return (
    <Fragment>


      <div class="btn-group-vertical btn-group-lg" role="group">
        {Object.keys(data[ran]).map(key2 => (

          <button type="button" class="btn btn-info" key={data[ran][key2]}>
            {data[ran][key2]}
          </button>

        ))}



      </div>




    </Fragment>

  );
};

export default ListLevels;
